import React from "react";

const CourseList = (props) => {
  console.log(props.courses);
  const courseArray = courses.map((course) => {
    return <li key={course.courseId}>{course.courseName}</li>;
  });

  return (
    <div>
      <ol>{courseArray}</ol>
    </div>
  );
};

export default CourseList;
